import styled from 'styled-components';

export const Label = styled.p`
    color: #000000;
    font-family: "poppins";
    font-size: 24px;
`;
export const Slider = styled.input`
    color: #000000;
`;

export const Result = styled.p`
    color: #F7B718;
    font-family: "poppins";
    font-size: 40px
`;

export const Container = styled.p`
    display: flex;
    align-content: flex-start;
`;
